{"de": "####INFO

Anzahl Zimmer

Die Anzahl Zimmer umfasst alle bewohnbaren Räume der Wohnung wie Wohnzimmer, Schlafzimmer usw. Nicht gezählt werden Küche, Badezimmer, Duschen, Toiletten, Abstellräume, Korridore, halbe Zimmer, Veranden sowie zusätzliche separate Wohnräume ausserhalb der Wohnung.", "fr": null, "it": null, "rm": null}

{"de": "#### INFO
Die Auswahl "Art der Arbeiten" nimmt einerseits Bezug auf das gesamte Bauprojekt. Wenn Sie also im Rahmen eines Bauprojekts sowohl Neubauten als auch Umbauten erstellen und wenn allenfalls im gleichen Bauprojekt auch Gebäude abgebrochen werden, können Sie auch mehrere Varianten gleichzeitig auswählen.

Andererseits erscheint die gleiche Abfrage auch unter der Rubrik "Hochbau" in der Tabelle "Gebäude und Anlagen". Dies deshalb, weil je nach Bauprojekt den Gebäuden allenfalls unterschiedliche bauliche Massnahmen zugeordnet werden müssen.", "fr": null, "it": null, "rm": null}

{"de": "####INFO

EGID ist die eidgenössische Gebäudeidentifikationsnummer gemäss dem Gebäude- und Wohnungsregister des Bundesamtes für Statistik (BfS)

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null, "it": null, "rm": null}

{"de": "####INFO

EWID ist die eigenössische Wohnungsidentifikationsnummer im Gebäude - und Wohnungsregister des Bundesamtes für Statistik (AfS).

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null, "it": null, "rm": null}

fields.static_content:
{"de": "#### Angaben zur Gebäudehülle
Materialien und Farbgebung der Fassade, der Gebäudeöffnungen (Fenster und Türen) und der Bedachung. Bei umfangreichen Projekten (z.B. Gesamtüberbauungen, grössere Bauten und Anlagen, Bauten in sensiblen Gebieten wie Kern- und/oder Ortsbildschutzzonen) bitten wir Sie, ein Farbkonzept einzureichen.

In diesem Zusammenhang verweisen wir auf das Merkblatt [Farbgebung in Ortsbildern und in der Landschaft](https://www.ur.ch/_docn/187162/Merkblatt_Farbgebung_in_Ortsbildern_und_in_der_Landschaft_Version_2.pdf)", "fr": "", "it": "", "rm": ""}

{"de": "**Gebäudetechnik**

Die Angaben zur Wärmequelle und zum Wärmeerzeuger für Heizung und Warmwasser sind je nach Art des Vorhabens zwingender Bestantteil einer Baueingabe. **Bitte erfassen Sie für alle gebäudetechnischen Anlagen jeweils einen separaten Datensatz** (z.B. für die Wärmequelle der Hauptheizung, für die Wärmequelle der Zusatzheizung und, falls vorgesehen auch für die Solaranlage usw.).

Für die nachträgliche Erfassung bzw. Meldung von gebäudetechnischen Angaben verwenden Sie bitte das Formular "GEBAUEDETECHNIK".", "fr": "", "it": "", "rm": ""}

{"de": "**Wichtige Hinweise**

- Parkplätze mit mehr als 300 Stellplätzen sind UVP pflichtig.

- Grundsätzlich ist bei allen Parkierungsanlagen zu prüfen, ob und wie viele behindertengerechte Parkplätze erstellt werden müssen.", "fr": "", "it": "", "rm": ""}

{"de": "**Bitte beachten:** Die Tiefbauten sind in zwei Kategorien unterteilt. Analog wie bei den Hochbauten können beliebig viele Tiefbauanlagen erfasst werden. 

- **Tiefbauten-Siedlung:** Diese Art von Tiefbauten wie z.B. Parkplätze, Veloabstellplätze oder Angaben zu den Anschlüssen wie Wasser, Abwasser usw. werden in der Regel im Zusammenhang mit einem Hochbauprojekt erstellt. 
- **Tiefbauten-Landschaft:** Diese Art von Tiefbauten wie Terrainveränderungen, Erschliessungen usw. werden in der Regel einzel als Bauprojekt eingereicht und folglich auch einzeln erfasst.", "fr": "", "it": "", "rm": ""}

{"de": "- ###<span style="color:red">Bitte für die korrekte Lokalisierung die folgenden Schritte beachten</span>

- <span style="color:red">Schritt 1</span> Suchen Sie die entsprechende Parzelle über das Feld "Parzellen oder Baurechtsnummer" und klicken Sie auf "Parzelle finden". Falls Sie die Parzellen- oder Baurechtsnummer nicht kennen, können Sie den Standort auch durch Verschieben und Scrollen der Karte bestimmen. Mit dem Setzen eines Markers wird die Parzellennummer unten angezeigt und mit Klick auf den Button "Daten übernehmen" (siehe Schritt 2) gespeichert. 

- <span style="color:red">Schritt 2</span> Klicken Sie in der Karte auf den entsprechenden Standort wo das Vorhaben realisiert wird. Es wird ein blauer Marker gesetzt. Der Marker kann durch erneutes Klicken auf der Karte beliebig verschoben werden. Klicken Sie anschliessend auf <span style="color:red">Daten übernehmen</span> und geben Sie dem System genug Zeit, die Daten zu speichern. Der GIS Ausschnitt wird automatisch unter Dokumente abgelegt.", "fr": "", "it": "", "rm": ""}

